sys_variable_value.value:
(function execute(inputs, outputs) {

  var responseBodyObject = JSON.parse(inputs.responseBody);

  if (responseBodyObject && responseBodyObject.data.length) {
    var sessionIdArray = [];
    var deletedSessionCount = 0;
    var deletedSessionLogCount = 0;

    responseBodyObject.data.forEach(function(session) {
        sessionIdArray.push(session.id);
    });

    var grSession = new GlideRecord('x_tesgh_veeam_app_session');
    grSession.addEncodedQuery('idNOT IN' + sessionIdArray.join(','));
    grSession.query();
    while (grSession.next()) {      
      var grSessionLog = new GlideRecord('x_tesgh_veeam_app_session_log');
      grSessionLog.addQuery('session', grSession.getUniqueValue());
      grSessionLog.query();
      if (grSessionLog.hasNext()) {
        deletedSessionLogCount += grSessionLog.getRowCount();
        grSessionLog.deleteMultiple();
      }

      grSession.deleteRecord();
      deletedSessionCount++;
    }

    outputs.deleted_session_count = deletedSessionCount;
    outputs.deleted_session_log_count = deletedSessionLogCount;
  }

})(inputs, outputs);

